package day12

import (
	"testing"
)

func TestComputeFencingPrice_Simple(t *testing.T) {
	var result = computeFencingPrice(`AAAA
BBCD
BBCC
EEEC`)
	if result != 140 {
		t.Errorf("Got %d instead of 140", result)
	}
}

func TestComputeFencingPrice_Simple2(t *testing.T) {
	var result = computeFencingPrice(`OOOOO
OXOXO
OOOOO
OXOXO
OOOOO`)
	if result != 772 {
		t.Errorf("Got %d instead of 772", result)
	}
}

func TestComputeFencingPrice_Complex(t *testing.T) {
	var result = computeFencingPrice(`RRRRIICCFF
RRRRIICCCF
VVRRRCCFFF
VVRCCCJFFF
VVVVCJJCFE
VVIVCCJJEE
VVIIICJJEE
MIIIIIJJEE
MIIISIJEEE
MMMISSJEEE`)
	if result != 1930 {
		t.Errorf("Got %d instead of 1930", result)
	}
}

